import Notification from './Notification'


const Notifications= (props) =>{

   // console.log(props.notifications);


    return(
        <div>
           
            {props.notifications.map(notification=>{
         
                <Notification notification={notification}/>
        })}
        </div>
    )
}

export default Notifications;
